import { Edit, Trash2, Plus } from "lucide-react";
import { getGuestPagination } from "../../services/guestsService";
import { useEffect, useState } from "react";
function MainAdmin() {
  const [data, setData] = useState([]);

  const handleDeleteGuest = () => {
    console.log("Xoa");
  };

  const handleUpdateGuest = () => {
    console.log("Upadte");
  };

  const handleCreateGuest = () => {
    console.log("Create");
  };

  useEffect(() => {
    async function getData() {
      const reslut = await getGuestPagination("guests");
      return reslut;
    }
    fetchData();

    setData(reslut.data.data);
  }, []);
  return (
    <>
      {" "}
      <div className="db-cent">
        <div className="db-cent-1">
          <p>Hi Jana Novakova,</p>
          <h4>Welcome to your dashboard</h4>
        </div>
        <div className="db-cent-3">
          <div className="db-cent-table db-com-table">
            <div className="db-title">
              <h3>
                {/* <img src="images/icon/dbc5.png" alt="" /> */}
                Khách hàng
              </h3>
              <p>
                There are many variations of passages of Lorem Ipsum available,
                but the majority have suffered alteration in some form
              </p>
            </div>
            <button
              style={{
                backgroundColor: "#ec5f67",
                color: "white",
                padding: "8px 16px",
                border: "none",
                borderRadius: "4px",
                cursor: "pointer",
                fontWeight: "bold",
                marginLeft: "520px",
              }}
              onClick={handleCreateGuest}
            >
              THÊM MỚI KHÁCH HÀNG
            </button>

            <table
              style={{ marginTop: "20px" }}
              className="bordered responsive-table"
            >
              <thead>
                <tr>
                  <th>No</th>
                  <th>Name</th>
                  <th>Email</th>
                  <th>Status</th>
                  <th>Actions</th>

                  {/* <th>City</th>
                  <th>Arrival</th>
                  <th>Departure</th>
                  <th>Members</th>
                  <th>Payment</th> */}
                </tr>
              </thead>
              <tbody>
                {data.map((item, index) => {
                  return (
                    <tr key={item.id}>
                      <td>{index + 1}</td>
                      <td>{item.fullname}</td>
                      <td>{item.email_address}</td>
                      {/* <a class="waves-effect waves-light btn">button</a> */}
                      <td className="waves-effect waves-light btn">
                        Hoạt động
                      </td>
                      <td>
                        <Trash2 onClick={handleDeleteGuest} />
                        <Edit onClick={handleUpdateGuest} />
                      </td>
                    </tr>
                  );
                })}
              </tbody>
            </table>
          </div>
          <div className="db-pagi">
            <ul className="pagination">
              <li className="disabled">
                <a href="#!">
                  <i className="material-icons">chevron_left</i>
                </a>
              </li>
              <li className="active">
                <a href="#!">1</a>
              </li>
              <li className="waves-effect">
                <a href="#!">2</a>
              </li>
              <li className="waves-effect">
                <a href="#!">3</a>
              </li>
              <li className="waves-effect">
                <a href="#!">4</a>
              </li>
              <li className="waves-effect">
                <a href="#!">5</a>
              </li>
              <li className="waves-effect">
                <a href="#!">
                  <i className="material-icons">chevron_right</i>
                </a>
              </li>
            </ul>
          </div>
        </div>
      </div>
    </>
  );
}

export default MainAdmin;
